import * as React from 'react'

import './mocks'

import {createTheme, ThemeProvider} from '@mui/material/styles'

import {AuthApp} from 'AuthApp'

const theme = createTheme({
  palette: {
    type: 'dark',
    primary: {
      main: '#E50914',
    },
    secondary: {
      main: '#E50914',
    },
  },
})

function App() {
  return (
    <ThemeProvider theme={theme}>
      <AuthApp />
    </ThemeProvider>
  )
}

export {App}
